import { jumbostron, Jumbotron, Container} from 'react-bootstrap'

var sectionStyle = {
    backgroundImage: `url(${phoneRep2})`,
    position: 'fixed',
    top: '0',
    width: '100vw',
    height: '100vh',
    backgroundSize: 'cover', 
}
